import React, {useState, useContext, useEffect} from 'react';
import { useCallback } from 'react';
import axios from 'axios';
impo

function Mapdata(props) {
  return (
    <div >
     <Box>
            <p>{props.au}</p>
    <a href={props.li}>{props.li}</a>
    <p>{props.na}</p>
    <p>{props.pro}</p>
        </Box>   

    </div>
  )
}

export default Mapdata
